public class JSONParser_pullValueTest {

    private JSONObject parameters;

    @Before
    public void setUp() {
        parameters = new JSONObject();
        parameters.put("key1", "value1");
        parameters.put("key2", 123);
    }

    @Test
    public void testPullValueExistingKey() {
        Object value = JSONParser.pullValue(parameters, "key1");
        assertEquals("value1", value);
        assertFalse(parameters.has("key1"));
    }

    @Test
    public void testPullValueNonExistingKey() {
        Object value = JSONParser.pullValue(parameters, "key3");
        assertNull(value);
        assertFalse(parameters.has("key3"));
    }

    @Test
    public void testPullValueNullParameters() {
        Object value = JSONParser.pullValue(null, "key1");
        assertNull(value);
    }

    @Test
    public void testPullValueMultipleKeys() {
        Object value1 = JSONParser.pullValue(parameters, "key1");
        Object value2 = JSONParser.pullValue(parameters, "key2");
        assertEquals("value1", value1);
        assertEquals(123, value2);
        assertFalse(parameters.has("key1"));
        assertFalse(parameters.has("key2"));
    }
}

public class JSONParser_sortJSONObjectTest {

    private JSONObject testJson;

    @Before
    public void setUp() {
        testJson = new JSONObject();
        testJson.put("b", 2);
        testJson.put("a", 1);
        testJson.put("c", 3);
    }

    @Test
    public void testSortJSONObject() {
        Map<String, Object> sortedParams = JSONParser.sortJSONObject(testJson);
        Map<String, Object> expectedSortedParams = new LinkedHashMap<>();
        expectedSortedParams.put("a", 1);
        expectedSortedParams.put("b", 2);
        expectedSortedParams.put("c", 3);

        assertEquals(expectedSortedParams, sortedParams);
    }

    @Test
    public void testSortJSONObjectEmpty() {
        JSONObject emptyJson = new JSONObject();
        Map<String, Object> sortedParams = JSONParser.sortJSONObject(emptyJson);
        Map<String, Object> expectedSortedParams = new LinkedHashMap<>();

        assertEquals(expectedSortedParams, sortedParams);
    }
}

